import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import { useNavigate } from 'react-router-dom';
import Navbar from '../components/Navbar';

const HomeContainer = styled.div`
  background-color: #f8f9fa;
  min-height: 100vh;
  padding: 1.5rem;
`;

const ContentWrapper = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  display: grid;
  grid-template-columns: 1fr 300px;
  gap: 2rem;

  @media (max-width: 768px) {
    grid-template-columns: 1fr;
  }
`;

const MainContent = styled.div`
  display: flex;
  flex-direction: column;
  gap: 1.5rem;
`;

const Title = styled.h1`
  color: #002B5C;
  text-align: center;
  font-family: 'Inter', sans-serif;
  font-size: 2rem;
  margin-bottom: 1rem;
  font-weight: 700;
`;

const Subtitle = styled.p`
  color: #666;
  text-align: center;
  font-size: 1.1rem;
  margin-bottom: 1.5rem;
`;

const RouteGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  gap: 1.5rem;

  @media (max-width: 768px) {
    grid-template-columns: 1fr;
  }
`;

const RouteCard = styled.div`
  background: white;
  border-radius: 12px;
  padding: 1.5rem;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.05);
  transition: transform 0.2s ease, box-shadow 0.2s ease;
  cursor: pointer;
  display: flex;
  flex-direction: column;

  &:hover {
    transform: translateY(-4px);
    box-shadow: 0 8px 12px rgba(0, 0, 0, 0.1);
  }
`;

const RouteHeader = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 1rem;
`;

const RouteName = styled.h2`
  color: #002B5C;
  font-size: 1.3rem;
  margin: 0;
  font-weight: 600;
`;

const StatusIcon = styled.div`
  font-size: 1.5rem;
  color: ${props => 
    props.status === 'on-time' ? '#28a745' : 
    props.status === 'delayed' ? '#dc3545' : 
    props.status === 'approaching' ? '#ffc107' : '#6c757d'
  };
`;

const RouteInfo = styled.div`
  display: flex;
  flex-direction: column;
  gap: 0.5rem;
`;

const NextArrival = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-top: auto;
  padding-top: 1rem;
  border-top: 1px solid #eee;
`;

const NextArrivalLabel = styled.span`
  color: #666;
  font-size: 0.9rem;
`;

const NextArrivalTime = styled.span`
  color: #002B5C;
  font-weight: 600;
  font-size: 1.1rem;
`;

const WeatherCard = styled.div`
  background: white;
  border-radius: 12px;
  padding: 1.5rem;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.05);
  height: fit-content;
`;

const WeatherHeader = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
  margin-bottom: 1rem;
  padding-bottom: 0.5rem;
  border-bottom: 1px solid #eee;
`;

const WeatherTitle = styled.h2`
  color: #002B5C;
  font-size: 1.2rem;
  margin: 0;
  font-weight: 600;
`;

const WeatherInfo = styled.div`
  display: flex;
  flex-direction: column;
  gap: 0.8rem;
`;

const WeatherDetail = styled.div`
  display: flex;
  justify-content: space-between;
  color: #666;
  font-size: 0.9rem;
`;

const WeatherValue = styled.span`
  color: #002B5C;
  font-weight: 500;
`;

const Temperature = styled.div`
  font-size: 2.5rem;
  color: #002B5C;
  font-weight: 600;
  text-align: center;
  margin: 1rem 0;
`;

const WeatherIcon = styled.div`
  font-size: 2rem;
  text-align: center;
  margin: 0.5rem 0;
`;

const LoadingSpinner = styled.div`
  text-align: center;
  color: #666;
  padding: 2rem;
`;

const ErrorMessage = styled.div`
  text-align: center;
  color: #dc3545;
  padding: 2rem;
  background: #fff5f5;
  border-radius: 8px;
  margin: 1rem 0;
`;

const Home = () => {
  const navigate = useNavigate();
  const [weather, setWeather] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // Sample route data - in a real app, this would come from an API
  const routes = [
    { id: 'OSW10', name: 'OSW10 Blue Route', status: 'on-time', nextArrival: '5 min' },
    { id: 'OSW20', name: 'OSW20 Red Route', status: 'delayed', nextArrival: '12 min' },
    { id: 'OSW30', name: 'OSW30 Green Route', status: 'approaching', nextArrival: '2 min' },
    { id: 'OSW40', name: 'OSW40 Yellow Route', status: 'on-time', nextArrival: '8 min' },
    { id: 'OSW50', name: 'OSW50 Purple Route', status: 'on-time', nextArrival: '15 min' },
    { id: 'OSW60', name: 'OSW60 Orange Route', status: 'delayed', nextArrival: '20 min' },
  ];

  useEffect(() => {
    const fetchWeather = async () => {
      try {
        setLoading(true);
        setError(null);
        console.log('Fetching weather data...');

        const API_KEY = 'ab385b44b9b33d12cf4397188ca4381b';
        const CITY = 'Oswego,NY,US';
        const UNITS = 'imperial';

        const url = `https://api.openweathermap.org/data/2.5/weather?q=${CITY}&units=${UNITS}&appid=${API_KEY}`;
        console.log('Fetching from URL:', url);

        const response = await fetch(url);
        console.log('Response status:', response.status);

        if (!response.ok) {
          const errorData = await response.json();
          console.error('Weather API error:', errorData);
          throw new Error(`Weather data not available: ${errorData.message || response.statusText}`);
        }

        const data = await response.json();
        console.log('Weather data received:', data);

        if (!data || !data.main) {
          throw new Error('Invalid weather data format');
        }

        setWeather(data);
      } catch (error) {
        console.error('Error fetching weather:', error);
        setError(error.message || 'Unable to load weather data. Please try again later.');
      } finally {
        setLoading(false);
      }
    };

    fetchWeather();
  }, []);

  const renderWeatherContent = () => {
    if (loading) {
      return <LoadingSpinner>Loading weather data...</LoadingSpinner>;
    }

    if (error) {
      return <ErrorMessage>{error}</ErrorMessage>;
    }

    if (!weather || !weather.main) {
      return <ErrorMessage>Weather data not available</ErrorMessage>;
    }

    return (
      <>
        <WeatherIcon>
          {weather.weather?.[0]?.main === 'Clear' ? '‚òÄÔ∏è' : 
           weather.weather?.[0]?.main === 'Clouds' ? '‚òÅÔ∏è' : 
           weather.weather?.[0]?.main === 'Rain' ? 'üåßÔ∏è' : 
           weather.weather?.[0]?.main === 'Snow' ? 'üå®Ô∏è' : 'üå§Ô∏è'}
        </WeatherIcon>
        <Temperature>
          {Math.round(weather.main.temp)}¬∞F
        </Temperature>
        <WeatherInfo>
          <WeatherDetail>
            <span>Feels Like</span>
            <WeatherValue>{Math.round(weather.main.feels_like)}¬∞F</WeatherValue>
          </WeatherDetail>
          <WeatherDetail>
            <span>Humidity</span>
            <WeatherValue>{weather.main.humidity}%</WeatherValue>
          </WeatherDetail>
          <WeatherDetail>
            <span>Wind</span>
            <WeatherValue>{Math.round(weather.wind.speed)} mph</WeatherValue>
          </WeatherDetail>
        </WeatherInfo>
      </>
    );
  };

  const getStatusIcon = (status) => {
    switch(status) {
      case 'on-time':
        return '‚úì';
      case 'delayed':
        return '‚ö†Ô∏è';
      case 'approaching':
        return 'üöå';
      default:
        return '?';
    }
  };

  return (
    <HomeContainer>
      <Navbar />
      <ContentWrapper>
        <MainContent>
          <Title>CENTRO BUS PREDICTOR</Title>
          <Subtitle>Real-time bus arrival predictions for Oswego, NY</Subtitle>

          <RouteGrid>
            {routes.map(route => (
              <RouteCard key={route.id} onClick={() => navigate(`/route/${route.id}`)}>
                <RouteHeader>
                  <RouteName>{route.name}</RouteName>
                  <StatusIcon status={route.status}>{getStatusIcon(route.status)}</StatusIcon>
                </RouteHeader>
                <RouteInfo>
                  <NextArrival>
                    <NextArrivalLabel>Next Arrival:</NextArrivalLabel>
                    <NextArrivalTime>{route.nextArrival}</NextArrivalTime>
                  </NextArrival>
                </RouteInfo>
              </RouteCard>
            ))}
          </RouteGrid>
        </MainContent>

        <WeatherCard>
          <WeatherHeader>
            <WeatherTitle>Oswego, NY Weather</WeatherTitle>
          </WeatherHeader>
          {renderWeatherContent()}
        </WeatherCard>
      </ContentWrapper>
    </HomeContainer>
  );
};

